def mapGraph( datasetsPURE, labels ):
    ""
    
    plt.figure(1)
    
    indx = 0
    
    for dataset, name in zip(datasetsPURE, labels):

        allPoses = np.array(dataset)
        
        plt.plot( allPoses[:,0], allPoses[:,1], lineStylez[indx], label=name )
        
        indx+=1

    plt.title("Robot path")
    plt.xlabel("X position")
    plt.ylabel("Y position")
    plt.legend()
    plt.show( block=False )
    
    ""

def asLocal( point1, point2 ):
    gOffset = point2 - point1
    
    sepLength = np.sqrt( gOffset[0]**2+gOffset[1]**2 )
    
    beta = np.arctan2( gOffset[1], gOffset[0] )
    newBeta = beta - point1[2]
    
    return np.array(( sepLength*np.cos(newBeta), sepLength*np.sin(newBeta), gOffset[2] ))

def errorPlot( datasetsPURE, labels, comSep, truePoseset ):
    ""
    
    errorResults = []
    
    plt.figure(3)
    
    indx = 0
    for dataset, name in zip(datasetsPURE, labels): 
        """
        getLocalOffsetFromNormal( this, offset:np.ndarray ): 

        thisPosition = this.getOffset()
        
        sepLength = np.sqrt( offset[0]**2 + offset[1]**2 )
        beta = np.arctan2( offset[1], offset[0] )
        
        newBeta = beta - thisPosition[2]
        
        localOffset = np.array((sepLength*np.cos( newBeta ), sepLength*np.sin( newBeta ), offset[2] ))
        
        return localOffset
        """
        dispErrors = []
        
        for pPose, nPose, pTPose, nTPose in zip( dataset[:-(1+comSep)], dataset[comSep:], truePoseset[:-(1+comSep)], truePoseset[comSep:] ):
            fOffset = asLocal( np.array(pPose), np.array(nPose) )
            tOffset = asLocal( np.array(pTPose), np.array(nTPose) )
            
            fLOffset = np.array(( np.sqrt(fOffset[0]**2+fOffset[1]**2), fOffset[2] ))
            tLOffset = np.array(( np.sqrt(tOffset[0]**2+tOffset[1]**2), tOffset[2] ))
            
            angularError = 100*( np.abs(fLOffset[1]-tLOffset[1])/(0.5*( tLOffset[1])) )
            dispError = 100*( np.abs(fLOffset[0]-tLOffset[0])/(0.5*( tLOffset[0])) )
            
            dispErrors.append( dispError )
            
            ""
        
        dispErrors = np.array(dispErrors)
        
        print("bbbb", name, np.mean(dispErrors), np.percentile(dispErrors, 25), np.percentile(dispErrors, 75) )
        
        plt.plot( np.arange( 0, len(dataset)-1-comSep )/(len(dataset)-1-comSep), dispErrors, lineStylez[1+indx], label=name )
        errorResults.append( dispErrors )
        indx+=1
    
    plt.legend()
    
    plt.xlabel("Fraction of journey complete")
    plt.ylabel("Percentage displacement error") 
    plt.title("Local displacement error over journey")
    plt.show(block=False)
    
    ""

